import React from 'react';

const StatusBadge = ({ status }) => {
  const map = {
    pass: { text: 'ผ่าน', cls: 'bg-green-100 text-green-800' },
    fail: { text: 'ไม่ผ่าน', cls: 'bg-red-100 text-red-800' },
    pending: { text: 'รอคะแนนครบ', cls: 'bg-gray-100 text-gray-800' },
  };
  const s = map[status] || map.pending;
  return (
    <span className={`px-3 py-1 rounded-full text-sm font-medium ${s.cls}`}>
      {s.text}
    </span>
  );
};

const Row = ({ label, value }) => (
  <div className="flex justify-between text-sm">
    <span className="opacity-80">{label}</span>
    <span className="font-semibold">{value}</span>
  </div>
);

const toFixedOrDash = (n, d = 1) =>
  (n === null || n === undefined || Number.isNaN(Number(n)))
    ? '-' : Number(n).toFixed(d);

const EvaluationCard = ({ student }) => {
  const {
    student_name,
    profile_image,
    supervisor_name,
    company_name,
    supervisor_score,       // 0–100
    company_score,          // ดิบ 0–120
    company_score_pct,      // 0–100 (จาก API)
    final_score,            // 0–100 (จาก API)
    final_status            // 'pass' | 'fail' | 'pending'
  } = student;

  const imgSrc = profile_image
    ? profile_image
    : 'https://via.placeholder.com/96x96.png?text=User';

  return (
    <div className="bg-white text-gray-900 rounded-2xl shadow-md p-5 flex gap-4 items-start">
      <img
        src={imgSrc}
        alt={student_name}
        className="w-16 h-16 rounded-full object-cover ring-2 ring-indigo-200"
      />
      <div className="flex-1">
        <div className="flex items-center justify-between gap-3">
          <div>
            <h3 className="text-lg font-bold text-gray-900">{student_name}</h3>
            <p className="text-xs text-gray-500">
              อาจารย์นิเทศ: {supervisor_name || '-'} · บริษัท: {company_name || '-'}
            </p>
          </div>
          <StatusBadge status={final_status} />
        </div>

        <div className="grid grid-cols-1 sm:grid-cols-3 gap-3 mt-4">
          <div className="bg-gray-50 rounded-xl p-4">
            <h4 className="text-xs uppercase tracking-wide text-gray-500 mb-2">คะแนนอาจารย์นิเทศ</h4>
            <Row label="คะแนน (เต็ม 100)" value={`${toFixedOrDash(supervisor_score, 0)}`} />
          </div>

          <div className="bg-gray-50 rounded-xl p-4">
            <h4 className="text-xs uppercase tracking-wide text-gray-500 mb-2">คะแนนสถานประกอบการ</h4>
            <Row label="ดิบ (เต็ม 120)" value={`${toFixedOrDash(company_score, 0)}`} />
            <Row label="คิดเป็น 100%" value={`${toFixedOrDash(company_score_pct, 1)}%`} />
          </div>

          <div className="bg-gray-50 rounded-xl p-4">
            <h4 className="text-xs uppercase tracking-wide text-gray-500 mb-2">สรุปรวม (60/40)</h4>
            <Row label="Final score" value={
              final_score == null ? '-' : `${toFixedOrDash(final_score, 1)}%`
            } />
            <Row label="เกณฑ์ผ่าน" value="≥ 70%" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default EvaluationCard;
